// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;
contract ReceiveSendEth{
    address owner;
    uint balance;
    constructor(){
        owner=msg.sender;
    }
    receive() payable external{
        balance+=msg.value;
    }
    function withdraw(address payable addr, uint amount) public{
        addr.transfer(amount);
    } 
}

